// call back 쓰는 이유
// 1. 메인 함수에 영향 없이 처리는 처리대로 따로 분리할 수 있어서
// 2. 함수 내부는 scope이 있어서 밖에서 꺼내 쓸 수 없으므로

function one(ms) {
  console.log('1 START');
  setTimeout(function () {
    var result = 1000;
    console.log('3 Result => ' + result);
  }, 2000); // 이게 0초여도  heap에 올라갔다 오므로 print2 후에 3이 찍힌다.

  console.log('2 END');
} // one(3000);
// Promise를 쓰는 이유
// callback의 callback을 쓰면 불편해서 아래와 같이.


var result = 0;
console.log('');

function two(ms) {
  console.log('1 START');
  setTimeout(function () {
    result = 1000;
    console.log('3 Result => ' + result);
    setTimeout(function () {
      result = result + 1000;
      console.log('4 Result => ' + result);
    }, result);
  }, 2000);
  console.log('2 END');
} // two(3000);
// promise


console.log('');

function promise(ms) {
  console.log('1 START');
  var promise = new Promise(function (resolve, reject) {
    // eslint-disable-next-line prefer-promise-reject-errors
    if (ms < 1000) reject('시간이 너무 짧습니다');
    setTimeout(function () {
      var result = 1000;
      resolve(result);
      console.log("Result => ".concat(result));
    }, 3000);
  });
  console.log('2 END');
  return promise;
} // 이러면 callback 지옥에 빠질 필요가 없다.
